import React from "react";
import "./card.style.css";

const Card = ({ key, monster }) => {
  return (
    <div className="card-container">
      <img src={`https://robohash.org/${monster.id}?set=set2&size=180x180`} alt="monster"/>  
      <h1>{monster.name}</h1>
    </div>
  );
};

export default Card;
